import React from 'react';
import { NavLink } from 'react-router-dom';
import '../style.css';
import ProjectBox from './ProjectBox';

const Home = () => {
  return (
    <div>

      <h1>Welcome to my website!</h1>
      <p>Here you can learn more about me and my work.</p>
      <section>
        <h2>My Projects</h2>
        <ul>
          <li><ProjectBox title="Python Event Planner" link="/projects/python-event-planner" /></li>
        </ul>
      </section>
    </div>
  );
};

export default Home;
